import React from "react";
import '../stylesheets/LabelOneField.css'

function LabelTwoFields(labelText1, inputId1, inputType1, inputPlaceholder1,
    labelText2, inputId2, inputType2, inputPlaceholder2){
    return(
        <div className="two-field-container">
            <div>
                <label htmlFor={inputId1}>{labelText1}:</label>
                <input id={inputId1} type={inputType1} placeholder={inputPlaceholder1}/>
            </div>
        </div>
    );
}

export default LabelTwoFields;
